import React, { useState } from "react";
import { Typography, Box, Button, Dialog, DialogTitle, DialogContent } from "@mui/material";
import { styled } from "@mui/system";

const ExerciseButton = styled(Button)({
  marginBottom: "16px",
  width: "100%",
  backgroundColor: "#f0f0f0",
  '&:hover': {
    backgroundColor: "#dcdcdc",
  },
});

const Biceps = () => {
  const [open, setOpen] = useState(false);
  const [currentExercise, setCurrentExercise] = useState("");

  const handleOpen = (exerciseName) => {
    setCurrentExercise(exerciseName);
    setOpen(true);
  };

  const handleClose = () => {
    setOpen(false);
  };

  return (
    <Box p={3}>
      <Typography variant="h4" gutterBottom>Biceps Exercises</Typography>
      <ExerciseButton variant="contained" onClick={() => handleOpen("Bicep Curl")}>
        Bicep Curl
      </ExerciseButton>
      <ExerciseButton variant="contained" onClick={() => handleOpen("Hammer Curl")}>
        Hammer Curl
      </ExerciseButton>
      <ExerciseButton variant="contained" onClick={() => handleOpen("Concentration Curl")}>
        Concentration Curl
      </ExerciseButton>

      {/* Popout Modal */}
      <Dialog open={open} onClose={handleClose}>
        <DialogTitle>{currentExercise}</DialogTitle>
        <DialogContent>
          <Typography variant="body1">
            Details about the {currentExercise} exercise go here.
          </Typography>
        </DialogContent>
      </Dialog>
    </Box>
  );
};

export default Biceps;
